/* eslint-disable import/no-default-export */
declare module "*.svg" {
  const content: string;
  export default ReactComponent as string;
}
declare module "*.jpg" {
  const content: string;
  export default content;
}

declare module "*.png" {
  const content: string;
  export default content;
}

declare module "*.json" {
  const content: string;
  export default content;
}
